import React from 'react';
import { Link } from 'react-router-dom';

const Sign_in = () => {
  return (
    <div>
    <div style={{fontSize:'20px',background:'blue',marginLeft:'50%',marginTop:'40px'}}><Link className="nav-link js-scroll-trigger" to={"/Sign_up"} style={{color:'white'}}>Sign_up</Link></div>
    </div>
  );
};

export default Sign_in;
